INSERT INTO `message` (`body`, `created`, `id`, `subject`, `thread`) VALUES
('yhrthgfhfghfghhgfg', '2009-02-15 16:18:53', 277, 'Message from the Cameleon team: ', '03040f4310f6d827a6b3535d5b0b16d7'),
('Did you get an email saying that you received message on Cameleon?', '2009-06-13 14:50:37', 278, 'Testing', '0ee5c8001cbd4406c1af24cf4dbeaa1b'),
('HI Matt,\r\nYup! I did. Three message arrived between 6:41 and 6:45 last night confirming the creation of a group.  I forwarded them to you. -M', '2009-06-14 07:06:46', 279, 're: Testing', '0ee5c8001cbd4406c1af24cf4dbeaa1b'),
('Hey Matt,\r\nI''m  up in Portland for the week-end visiting family and have been playing with cameleon brifly while Miles naps.  Awesome features on the email editing!!!!  huge benefit for admins.  This site really has some cool functionality!  You should be proud.  I''m psyched to get it in use soon.\r\n\r\nI''ve noticed a couple bugs.  Messaging from groups gave me an error, and I still can update user or group profile pics.  Also if I create a new user I can log in once but then logging in again give me an "invalid credentials\r\n"  ALl little stuff but thought you would like to know!!!  talk to you soon, -M', '2009-06-27 15:16:43', 280, 'HI ', 'bd9e5bb85671074eb6395ef1d395554d'),
('Hey Mike,\r\n\r\nI believe I''ve fixed all 3 of these bugs. The group message wasn''t working because of some minor JavaScript issues, which were easy to fix. The user/group profile images were broken, because ''portrait'' is a special tab name. Locally, I have all the tabs lower-case, but they are on the upper-case on the server. I made the tab check case-agnostic, so it works fine now on the server. Lastly, the user credentials were caused because the registration link in the new user email was not clicked on. Unfortunately, the order of operations caused the wrong message to be shown to the user. This should be fixed now.\r\n\r\nI also went through the JavaScript for the Mailbox pages and fixed it (this allows the select all/none/etc. stuff to work again). I think I punted these when I did the mailbox/message redesign, but now it should all work again. ', '2009-07-05 15:52:32', 281, 're: HI ', 'bd9e5bb85671074eb6395ef1d395554d'),
('HI Matt,\r\n\r\nJust wanted you to know I got the message and will be testing stuff!!! -M', '2009-07-06 08:33:08', 282, 're: re: HI ', 'bd9e5bb85671074eb6395ef1d395554d'),
('Hi Matt,\r\nI have noticed you ahve made more changes to the site and it is working pretty well!\r\n\r\nI sear the quick search moved intot he body of the page from the header.  I''m creating some test users and taking notes!\r\n\r\nLet me know you go this!!!!  Otherwise I''ll email ya! -M', '2009-07-16 12:15:09', 283, 'Site looks great!', '5208f04b6989e370a36b7aaacebd3025'),
('drfsdfasdfa', '2009-07-16 13:25:54', 284, 'test message to derek', '687430fc1e438153d2d2c5681b777f29'),
('I got this!', '2009-07-18 17:53:47', 285, 're: Site looks great!', '5208f04b6989e370a36b7aaacebd3025'),
('Hi Matt!!\r\n\r\nI''ve been playing with the site a bit creating some users, and teams ans messaging between them etc...  and noticed something small...  When you look at teams the member count is always 0 so it isn''t reflective of the number of members on a team... -M', '2009-07-21 18:01:13', 286, 'Team member count', '40bb14419cc9c2078a6f7997010b01a7'),
('test message to all FA Azzurri memebers', '2009-07-21 18:02:02', 287, 'Message from Group: FA Azzurri', '14baa54451bc925e505ccf1dfdad1c76'),
('Hey Mike, I''ve fixed the friends count on groups. It was just something I had punted on during the redesign, but it was time to get it working again. ', '2009-07-25 18:02:46', 288, 're: Team member count', '40bb14419cc9c2078a6f7997010b01a7'),
('awesome.  I''m adding more users and playing with the site some today to get ready fo the meeting tomorrow. -M', '2009-07-25 18:08:43', 289, 're: re: Team member count', '40bb14419cc9c2078a6f7997010b01a7'),
('Great. I added an event for tomorrow ^_^. I also sent you a regular email detailing some changes I made to the custom fields backend.', '2009-07-25 18:21:45', 290, 're: re: re: Team member count', '40bb14419cc9c2078a6f7997010b01a7'),
('testing message to all users', '2009-08-04 13:45:37', 291, 'Message from the Silicon Valley Soccer team: ', '2d474d43acf9da9b15802d7be7f5d1d8'),
('Hey Matt,\r\n\r\nWhenever I try to edit profile (from the "edit" link on side bar) or try hitting "edit" for most of the sub sections of the profile page I get a database error.  Do you get the same?  I''m ready to demo to the Soccer league director, but would like to resolve that first...\r\n\r\nCan you check it out and see if you see what I do?\r\n\r\nthanks!  -M', '2009-08-10 17:13:17', 292, 'edit profile errors...', 'a388dc1ef2c1aa3fe27888aaf47f469f'),
('Man, why you always breaking things...\r\n\r\nActually, I had removed a file that was no longer being used, except I didn''t realize that it was defining a bunch of constants that were being used for profile editing. I moved the constants to a better place and it is now fixed.\r\n\r\nSorry about the inconvenience.\r\n-matt', '2009-08-12 11:06:51', 293, 're: edit profile errors...', 'a388dc1ef2c1aa3fe27888aaf47f469f'),
('Cool, thanks.\r\n\r\nI live to break things,  -M', '2009-08-13 18:36:47', 294, 're: re: edit profile errors...', 'a388dc1ef2c1aa3fe27888aaf47f469f'),
('THere are two users (diego ventura and erin Linke) whose portraits can see when I''m logged in as them, but I can''t see them when I do a search with ""no term" to see all users...  In other words the portrait is loaded but doesn''t always show up...  I''ll see if there are other instances where they do not show up. -m', '2009-08-13 20:30:19', 295, 'here is an odd one...', '2386a680e6b73153613ec8398c8cfe51'),
('Couldn''t "create" a team today.  I wanted to creat a new team to see if all my teamates showed up as an option to invite.  that feature was a bit hard for me to be sure it was working properly...\r\n\r\n-M', '2009-08-14 15:38:34', 296, 'creat a team seems broken', 'ce3e94d134fb21bbbf6b1d8470dbc375'),
('Minor correct to my last message...\r\n\r\nWhen I created a team I got an apache error page, but the team was created anyway...  then when I check to see who on my teamate I could invite that list was not inclusive of all my existing team mates....  Something about the invite list is a bit wonky...', '2009-08-14 15:40:20', 297, 'CORRECTION', 'ab29ff44efa8fae82959914257790f31'),
('New administrator feature added - targeted messaging. You can now send messages to all users, users who are members to specific groups, or just a collection of individual users. This message is a test of this new system.', '2009-08-16 16:46:54', 298, 'Message from the Silicon Valley Soccer team: ', '874d3a3f736f346b461cb66bcc518bc6'),
('Hey Matt!\r\n\r\nThe targeted messaging looks great!  Nice work!  I''ve been playing with the site a bit this AM.\r\n\r\nI think we are getting close to being ready to demo.  I was wondering if you are OK with me letting couple of my soccer friends log in under the demo users accounts to play with the site to see if they have any feedback or find bugs?\r\n\r\n-M', '2009-08-17 12:22:02', 299, 're: re: edit profile errors...', 'a388dc1ef2c1aa3fe27888aaf47f469f'),
('Hey Mike,\r\n\r\nFeel free to share this with a few select people. We could use a little feedback at this point.\r\n\r\nAlso, I have added a basic content management system, similar to the email management system. It''s on the general tab and it allows admins to change the on the signup form and the welcome message. I also rolled the about page and TOS into this system as well. Eventually, we''ll hook in a WYSIWYG editor, but I''m pretty happy with the current feature.\r\n\r\nFYI: There are only 2 tasks left on the roadmap, before we are technologically BETA ready. \r\nhttp://wiki.cameleon.mattsnider.com/index.php?title=Feature_Roadmap#Pre-Beta', '2009-08-17 23:41:26', 300, 're: re: re: edit profile errors...', 'a388dc1ef2c1aa3fe27888aaf47f469f'),
('testing', '2009-08-18 08:44:52', 301, 'Message from the Silicon Valley Soccer team: ', '1b7b1820f2d7ed1eee9776c716eaa487'),
('HI Matt,\r\n\r\nI''m getting ready to give a handful of users access for testing adn went to delete a t TEAM today.  It looks like we have lost teh "delete team" function.  It was a team that I am an admin of...\r\n\r\nDid I just miss it?  -M', '2009-08-20 06:35:35', 302, 'TEAMS', '2f7607c1f21f4547e75c41ecaf00dbbe'),
('There are 6 teams that I see, all of which have at least 2 members. You must first delete all the members, before you can delete a team. This prevents people from accidentally deleting a group. I will add it to my list of things to do, to message this better.', '2009-08-25 10:02:24', 303, 're: TEAMS', '2f7607c1f21f4547e75c41ecaf00dbbe'),
('OK Cool. That makes sens and I think a bit of explanation is all that is needed.   I did try to delete members and got an error. I tried to delete Julie miller from the "Test invite team" which has 3 members...\r\n\r\nSo perhaps deleting members is problematic?  -M', '2009-08-25 16:59:42', 304, 're: re: TEAMS', '2f7607c1f21f4547e75c41ecaf00dbbe'),
('Hey Mike, it took me longer today to get the member stuff fixed than I anticipated. As far as I could tell there was no logic for removing a member, only removing administrators. It must have been lost somewhere in the redesign from Geekster. Anyway, I fixed the ability to remove a member from a group.\r\n\r\nI also looked into Erin and Diego. It turns out that the logic to become a user was matching the first instance of a User with a given name in the database, not the first `active` one. Diego and Erin both have `deleted` users with the same name. So you had updated the profiles of the `deleted` users, instead of the `active` ones. I have fixed the logic to only allow Admins to become `active` users, and I migration your data to the correct user. You should now see the portrait for these two users when you search.\r\n\r\nI will be looking into the creating a group and custom field issues tomorrow morning.', '2009-08-26 00:58:48', 305, 'Some Fixes Made', 'c080be5b2109401c78429f4413d440a6'),
('awesome.  Thanks! -M', '2009-08-26 06:34:42', 306, 're: Some Fixes Made', 'c080be5b2109401c78429f4413d440a6'),
('I checked this stuff all out and things look good. It looks like the DB error on the Soccer info (new Widget) i made is fixed a bit. It now appears in the profile pages but a couple of the custom fields are broken.  We are getting there!\r\n\r\nDiego and Erin look fixed and I''m very close to being able to invite these folks to play around. In fact we can delete the Soccer info widget if we want to start the testing....  Depends on when you have time to get to it and your comfort level with it.\r\n\r\nthansk for the fast turn around! -M', '2009-08-26 12:39:16', 307, 're: Some Fixes Made', 'c080be5b2109401c78429f4413d440a6'),
('Hello Everyone!  Welcome to the first round of the Beta Test.  Thanks so much for participating!  You will be rewarded.  This message courtesy of the administrators "messaging" system...  This is how we will keep you informed of bug fixes or new features we turn on.   -Mike', '2009-08-30 14:54:03', 308, 'Message from the Silicon Valley Soccer team: ', 'b36a326efabdcdc81c1432e2a0df14d7'),
('Hey Mike, just wanted to let you know that I fixed the categories and many other minor issues with the ''select'' type. It took me a long time to realize why your new ''select'' types weren''t working (ie. you can''t add new values). It is because when the necessary tables are setup the name is being truncated to just and ''_''. Because of this you can never add values to them. I went through and deleted all the broken types that were currently in the system, because they were in an unrecoverable state. I will be looking into the issue in the morning. Please don''t create any new ''select'' type fields until I let you know that it is working. You can edit existing ones, just not create new ones.', '2009-08-31 00:22:20', 309, 'New Select Type is Broken', 'e722379294a164a734f50d2dbe300382'),
('got it.  Thanks again fo rhte rapid follow up!  I will only edit the two ones I created yesterday for the my soccer profile widget as a test.  Thanks!', '2009-08-31 08:23:08', 310, 're: New Select Type is Broken', 'e722379294a164a734f50d2dbe300382'),
('Mike,\r\n\r\nThe issue is fixed. There was an order of operations problem, causing the select type to attempt to setup its related data tables before it knew that it was a select type. And chaos ensued. Any now that it is fixed, I went ahead and added the "Available to Sub" field. I don''t remember what the other one was.\r\n\r\n-matt', '2009-08-31 09:07:13', 311, 're: re: New Select Type is Broken', 'e722379294a164a734f50d2dbe300382'),
('here are things I found:\r\n\r\nIn Basic Info ---- About Me is tagged w/ asterisk as mandatory. Does it need to be?\r\n\r\non test widget --- On Days and Time I can Play - IT might make more sense from query stdpt if it was NOT free text but rather standardized options.  From a  mgr standpoint...it might make a query simpler.  Might also want to have a query option for managers?\r\n\r\n\r\n', '2009-08-31 10:11:11', 312, 'testing...', '59476e7ef328aeca4be68f7a44c04d88'),
('Great. I will go in now and make some edits! ', '2009-08-31 13:20:35', 313, 're: re: re: New Select Type is Broken', 'e722379294a164a734f50d2dbe300382'),
('Hey John,\r\nTHanks!!!  Those are good observations.\r\n\r\nWhat is cool about your suggestions is that I can edit your two comments right in the administrators tools.  We are in the process of making multiple selections possible which would address you days of the week suggestion.  You could pick from a list (multiple selections)  That is a post beta feature, but 100% planned.  The Asterisk for required is also an admin option.  I planted some in odd places to see if people got stuck!  :>  I''ll remove it.  I''ve edited the my soccer section a bit already. Check out the changes.\r\n\r\nPS we really missed you on Friday!  but the upside is we got 3 new girls at lease one of which will join full time and she is good!  -M', '2009-08-31 13:26:33', 314, 're: testing...', '59476e7ef328aeca4be68f7a44c04d88'),
('Hey Long lost friend, Just testing out the new account... ; ) Hope your well!\r\n', '2009-09-01 11:57:12', 315, 'Hey Baby....', 'e037af12454cc6b109284c3c135a8747'),
('Hey THere,\r\n\r\nI''min Boston for work and I''m taking a few minute to peek at the site.  One thing I think might be a useful feature would be to display the "last update" time in the page where we display a users "Team Mates" or friends and also in the list when they all appear when you "browse".  That way you can look at you list of friends and see when they logged in last...  As part of beta testing it would allow me to get a quick sense of site activity!\r\n\r\nOn other thing I noted was that in selecting people to invite to a group you could check multiple name but it only invited one. So I checked one at a time and just repeated.  -M', '2009-09-02 14:14:11', 316, 'HI MAtt', '1f44cf74fa93e51d825a944608525022'),
('Mike,\r\n\r\nI went ahead and added the "last updated" to search results. There are some filters at the top of the friends (teamates) page that allow you to see recent activity as well. Also, I fixed the group (teams) invite so that it sends multiple requests. I was stopping the loop after I found the first user for some reason. Let me know if you find anything else.', '2009-09-03 09:28:44', 317, 're: HI MAtt', '1f44cf74fa93e51d825a944608525022'),
('Awesome. Thanks!!! -M', '2009-09-04 15:33:37', 318, 're: re: HI MAtt', '1f44cf74fa93e51d825a944608525022'),
('Wassup girl :)\r\n\r\nYou were born in 1995?', '2009-09-10 17:43:22', 319, 'Hi', '770094c0c6194a31a7dd87f0164a241a'),
('What up Bee-otch! Just doing my part and testing this thing out... when & where you play your next Men''s game?', '2009-10-01 11:27:52', 320, 'How many men?', 'af9c911cd39a9eb21c75a77813bd6bc9'),
('What the hell happend to the Buffs this year? They were clowing them on sports talk radio this morning....keep your head up! ; )\r\n\r\nOn the other hand...the Niners are looking kind of special this season. About time!!!', '2009-10-01 11:30:30', 321, 'Test 1...test 2', 'e86d90332cb357916fd7a759b951bc5d'),
('Sorry it took me so long to get on board! Talk about procrastination! \r\n\r\nAs far as Colorado goes, the Buffaloes are terrible! When they played Toledo and lost bad, I knew we were in trouble! HOLY TOLEDO! \r\n\r\nBy the way, it was so good to see you the other night at the Old Pro. Always fun to catch up with you. We should do that more often. I have finally finished my landscaping so I need to have more people over to enjoy it....how would you like to join me in a cocktail, beer, etc sometime soon? \r\n\r\nAlso, you should definitely come to my sis'' house on Monday night for football....it has been super yummy lately! \r\n\r\nHope you are having a great weekend -\r\nMolly', '2009-10-03 16:05:51', 322, 're: Test 1...test 2', 'e86d90332cb357916fd7a759b951bc5d'),
('Hey Matt,\r\n\r\nI''m in Chicago for work (at a conference) and it has been hectic.  I checked into cameleon this am just to poke around and notice you made some UI changes.  Likes good.  I spoke to my friend Alan in Salt lake yesterday na dhe thinks we could approach both his Duaghters private school for feedback and possibly a beta test and also his church.  I''ll work on that and maybe we can get together this weekend to catch up about beta feedback and next steps?  I''m around both days. I have a game Sunday from 12:30-2:30 otherwise free...   easiest communication is via txt while I''m traveling.   -Mike', '2009-10-22 05:53:56', 323, 'HI There', 'a10bcbec8bb2a6b5337304318991b153'),
('register or die', '2009-12-06 15:21:39', 324, 'Message from the Silicon Valley Soccer team: ', 'ab96521c29b8997f18499ed8db498599'),
('just testing disregard last email there is nothing to register for', '2009-12-06 15:43:14', 325, 'Message from the Silicon Valley Soccer team: ', '5fb4c7dc1409c7310d0904d8f35f4443'),
('Just though I would put a message in you inbox...  -M', '2009-12-09 19:48:49', 326, 'HI Paiman!', '2935885019d1cd46a083ef52821c265b'),
('Admin tabs have been consolidated and improved. Subtabs are now being used to allow more content and descriptions.\r\n\r\nJavaScript library has been upgraded from YUI 2 to YUI 3. Currently, this is causing issues with the fields manager and autocomplete, but I am working on it.\r\n\r\nNew tabbing widget added, when use it allows the user to view tabs using JavaScript instead of requiring a page reload. Currently it is used on the login page.\r\n', '2009-12-13 01:19:35', 327, 'Message from the Cameleon team: ', '970a4e8fd6d507e7d1a0fd9b22da66f5'),
('Hi Matt,\r\nI have only had this problem with one field but I can''t get to the the edit capability for the biographical tab field "Interests and hobbies".  It doesn''t display the option to hide, edit etc...  All the other fields in this tab seem to work fine.', '2009-12-29 16:44:13', 328, 'bug', 'efe7b920c913c0941d01a9d75b411f86'),
('Write something...', '2009-12-30 19:29:29', 329, 'Message from the Cameleon team: ', '85859ac2a0ff6f8c31be838f88a5fad2'),
('Hey Mike,\r\n\r\nIt was actually the ''&'' that was causing the issue. There are certain characters that HTML treats specially, known as HTMLEntities and ''&'' is one of them. Anyway, I needed to escape it for it to work properly. This might be a problem elsewhere and is something we should check throughout the site.', '2009-12-31 10:02:53', 330, 're: bug', 'efe7b920c913c0941d01a9d75b411f86'),
('interesting!  Good catch.   -M', '2010-01-07 06:55:18', 331, 're: re: bug', 'efe7b920c913c0941d01a9d75b411f86'),
('Hey Mike, I just wanted to let you know that I updated the features page in the admin configuration options. Besides having a better UI, it now supports turning the network feature on and off. Behind the scenes I have improved the way this page works, so if we add additional content like Networks or Groups, then this page will automatically support them.\r\n\r\nhttp://cameleon.mattsnider.com/admin.action?page=config&task=modules', '2010-01-10 13:17:48', 332, 'Updated Feature page', '68f48f341febe5636b9eddfd06a97b2a'),
('Hi Matt,\r\nI checked the bug in IE and I CAN use the save button in profile edit in IE.  Brokin in IE was the ability to move the profile tabs up and down relative to each other usign the up and down arros.  So there are minto things that break in each browser...\r\n\r\n-M', '2010-02-05 14:59:04', 333, 'Browser info', ''),
('HI Matt,\r\nIm my tinkering I have noted that if I use default values in fields when setting up profile fields they do not seem to be saved.  Also shen I created a field of teh "select" type the vales I put in were not saved.  he other thing I noted was that field selcect to be "required" are not currently throwing a flag is not filled in. -M', '2010-02-05 15:49:46', 334, 'little broken items', ''),
('nevermind the comment about "select" based boxes not saving teh default options.  It is only the field that says "default value" for various profile fields that sems not to save.  I forgot tha the "select" field typ created a new box for the default option.', '2010-02-05 16:09:59', 335, 'one correction', ''),
('nevermind the comment about "select" based boxes not saving teh default options.  It is only the field that says "default value" for various profile fields that sems not to save.  I forgot tha the "select" field typ created a new box for the default option.', '2010-02-05 16:10:05', 336, 'one correction', ''),
('Thanks for the testing Mike,\r\n\r\nI tried to replicate the issue you were experiencing with FF on XP and couldn''t. It seemed to work fine for me. What version of FF are you using?\r\n\r\nI think ''required'' is a feature we only have implemented. I have in my notes that I need to flag them so that users are required to fill them out, but I don''t think it is currently implemented that way.\r\n\r\nI''ll take a look at the default value tomorrow. I can''t remember if I fully implemented that or just put in a placeholder. I vaguely remember getting stuck on how to implement it with select type fields.\r\n\r\n-matt', '2010-02-06 00:53:34', 337, 're: one correction', ''),
('Mike, I checked, and the "default value" is definitely a work in progress. So, both "default value" and "required" are only partially implemented. I have them on my roadmap for what I am calling the Beta 2 Release, which is the Paiman deliverable ^_^', '2010-02-06 09:43:22', 338, 're: re: one correction', ''),
('HI Matt,\r\n\r\nI had the problem in FF version 3.5.7 and just upgraded to version 3.6 and it went away.  So I thin kit is solved for now.  Sorry for the red herring....  I thought I was on the most recent FF version.  -M', '2010-02-06 19:47:27', 339, 're: re: one correction', ''),
('Hey Matt,\r\nhere at work on FF on XP when I try to get to my profile via the sidebar link I get an apache error page.', '2010-02-08 11:23:54', 340, 'my profile', ''),
('-matt', '2010-02-12 00:01:28', 341, 'Group creation is working again', ''),
('This is a test message.', '2010-02-15 13:36:38', 342, 'Message From Silicon Valley Soccer Network', '838bdd6d0a6aac2a843b62c6b0c25c87'),
('You can test the message system now. I should work for groups, networks, and administrators now. In addition, I have a added a new link on the sidebar for users, "Write Message". This allows users to write messages to all their friends, or to select a few.', '2010-02-15 13:39:09', 343, 'The message system is working.', '200a48d51c2b47bcfe0176165d269bd3'),
('test', '2010-02-15 15:07:38', 344, 're: The message system is working.', '200a48d51c2b47bcfe0176165d269bd3'),
('re: The message system is working.\r\n\r\nHey MAtt. I will play with messaging. I did create a "status" widget and have added some more divisions to the womens sunday league.  The site is working well and seems to be a bit faster!  -M ', '2010-02-15 15:09:38', 345, 'Got it', 'ea5b2a0f32b8010eca7ef9f6f3606832'),
('Kool. Let me know if you find anything. Search results actually should be faster, as I reduced the number of queries that were being made by 2 per returned result. ', '2010-02-19 08:41:17', 346, 're: Got it', 'ea5b2a0f32b8010eca7ef9f6f3606832'),
('While responding to this message, I realized that there was an issue with the reply system, but it should be fixed now. Additionally, search results should actually be faster as I reduced the number of DB queries made by each result by 2. Let me know if you find any issues.', '2010-02-19 08:46:30', 347, 're: Got it', 'ea5b2a0f32b8010eca7ef9f6f3606832'),
('While responding to this message, I realized that there was an issue with the reply system, but it should be fixed now. Additionally, search results should actually be faster as I reduced the number of DB queries made by each result by 2. Let me know if you find any issues.', '2010-02-19 08:56:38', 348, 're: Got it', 'ea5b2a0f32b8010eca7ef9f6f3606832'),
('this is a test', '2010-02-19 10:22:22', 349, 'sending message to all friends', 'a2850ae4df48abb3209c43e2b184816a'),
('Hey Matt,\r\nThought I would check in. I see you have done more with messaging.  I will play with the site this week-end...  I had to spend the day in Berkeley yesterday and didn''t have much time at y desk. I was thinking I might show Paiman the improvements.  I think the messaging will be big for him.  Are you planning any changes in it this week-end?  Should I wait?  HE is hard to set up an appointment with but I may try.  Will keep you posted!  -M', '2010-02-20 11:52:50', 350, 're: sending message to all friends', 'a2850ae4df48abb3209c43e2b184816a'),
('Hi Matt,\r\n\r\nDue to headcount reduction downstream from the acquisition at my company my job has been "eliminated"  so I am now unemployed...  So I''m not sure if that is good or bad news but it will give me a lot more time to catch up and work on Cameleon and to set up appointments with Paiman and get things moving...  That sounds like good news, but of course might make me more of a pest....\r\n\r\nThe changes look good! When you have a minute let''s catch up! -Mike', '2010-02-23 11:12:34', 351, 'NEWS!!! Good and bad', '18b3735bc152f703c37840dca2431397'),
('Welcome to the "write message" demo...  -M', '2010-02-26 10:58:22', 352, 'HI Paiman!', 'a0319f80945471ab3f3a3dc9535f022d'),
('Hi Matt,\r\n\r\nI see you pushed the hyperlink fix and the user edit fix through already!  I have cleaned up the profile filed names and positions a lot in prep for tomorrow.  The only problem I have encountered is that the link to send a message to a group (for admins) throws and error.\r\n\r\nI thought I would show that to Paiman, but if it isn''t working I can avoid it.  Just wanted you to know. -M', '2010-02-26 15:04:18', 353, 'Only found one bug all day', 'd135ad67a355fe43e5ccfa4fc1d33736'),
('Cool. I fixed that as well. You should also be seeing notifications now.', '2010-02-27 09:27:10', 354, 're: Only found one bug all day', 'd135ad67a355fe43e5ccfa4fc1d33736'),
('Hello World!', '2010-02-27 13:21:22', 355, 'Test Message from John', '90c71105b623f8586ceb36506afe108a'),
('Looks great!\r\n\r\nI like the  notifications.  What kind of communications feed into the notifications line up? Admin new blasts and ?  I''m sure it is up to us but i"m curious what you had in mind... -M', '2010-02-27 13:25:13', 356, 're: re: Only found one bug all day', 'd135ad67a355fe43e5ccfa4fc1d33736'),
('Hey Mike,\r\nYou should see the content of this message in your email. I have updated the logic so that the user message is sent directly to the email address.\r\n\r\nThere is a small risk that someone could write something malicious here, but as you can see, I cannot send you an link:\r\n\r\nLINK', '2010-03-02 21:01:56', 357, 'Messages In Emails', 'a891a339afd7c9dd8f317d748824e093'),
