('HI Matt,\r\nI noticed in the create a group function there is a drop down menu for the group type.\r\n\r\nIn cameleon it is team group other\r\n\r\nIn socialmize it is \r\ngroup advanced, premiere.\r\n\r\nI can''t find where to edit the drop down... is it hard coded but different for each site?  or am I just brain dead on how to edit that?  -Mike', '2010-08-10 18:41:04', 367, 'create a group function', '376cdf6e12edc0d0e7e44e9a9e4240f3'),
('You probably can''t edit it, unless you add a new profile field named "category". I was supposed to remove that requirement from group creation. What you are seeing is legacy from the last time categories were updated on cameleon, before I created socialmize.\r\n\r\nMatt', '2010-08-10 23:48:07', 368, 're: create a group function', '376cdf6e12edc0d0e7e44e9a9e4240f3'),
